import React, { useEffect, useState } from 'react';
import { getProperties, createProperty } from '../utils/api'; // Import centralized API functions

function Dashboard() {
  const [properties, setProperties] = useState([]); // State to store properties
  const [loading, setLoading] = useState(true); // State to track loading status
  const [error, setError] = useState(null); // State to track errors
  const [newProperty, setNewProperty] = useState({
    name: '',
    address: '',
    parkingSpots: 0,
  }); // State for new property form

  useEffect(() => {
    /**
     * Fetch properties from the backend.
     */
    const fetchProperties = async () => {
      try {
        const data = await getProperties(); // Use centralized API function
        setProperties(data); // Update state with fetched properties
      } catch (err) {
        console.error('Error fetching properties:', err.response?.data?.message || 'An error occurred');
        setError(err.response?.data?.message || 'Failed to load properties'); // Set error message
      } finally {
        setLoading(false); // Stop loading regardless of success or failure
      }
    };

    fetchProperties(); // Call the fetch function
  }, []);

  /**
   * Handle form input changes for creating a new property.
   */
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewProperty({ ...newProperty, [name]: value });
  };

  /**
   * Handle property creation.
   */
  const handleCreateProperty = async (e) => {
    e.preventDefault();
    try {
      const createdProperty = await createProperty(newProperty); // Call API to create property
      setProperties([...properties, createdProperty]); // Add new property to the list
      setNewProperty({ name: '', address: '', parkingSpots: 0 }); // Reset form
    } catch (err) {
      console.error('Error creating property:', err.response?.data?.message || 'An error occurred');
      alert('Failed to create property: ' + (err.response?.data?.message || 'Please try again'));
    }
  };

  return (
    <div className="p-8">
      {/* Dashboard Header */}
      <h1 className="text-3xl font-bold mb-6">Property Manager Dashboard</h1>

      {/* Loading State */}
      {loading && (
        <div className="flex justify-center items-center h-40">
          <span className="text-lg text-gray-600">Loading properties...</span>
        </div>
      )}

      {/* Error State */}
      {error && (
        <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded relative" role="alert">
          <strong className="font-bold">Error:</strong>
          <span className="block sm:inline"> {error}</span>
        </div>
      )}

      {/* Create Property Form */}
      <div className="mb-6">
        <h2 className="text-xl font-semibold mb-4">Create New Property</h2>
        <form onSubmit={handleCreateProperty} className="space-y-4">
          <input
            type="text"
            name="name"
            placeholder="Property Name"
            value={newProperty.name}
            onChange={handleInputChange}
            className="w-full p-2 border rounded"
            required
          />
          <input
            type="text"
            name="address"
            placeholder="Property Address"
            value={newProperty.address}
            onChange={handleInputChange}
            className="w-full p-2 border rounded"
            required
          />
          <input
            type="number"
            name="parkingSpots"
            placeholder="Number of Parking Spots"
            value={newProperty.parkingSpots}
            onChange={handleInputChange}
            className="w-full p-2 border rounded"
            required
          />
          <button type="submit" className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600">
            Create Property
          </button>
        </form>
      </div>

      {/* Properties List */}
      {!loading && !error && (
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {properties.length > 0 ? (
            properties.map((property) => (
              <div key={property._id} className="bg-white p-6 rounded shadow-md">
                <h2 className="text-xl font-bold">{property.name}</h2>
                <p className="text-gray-600">{property.address}</p>
                <p className="mt-2">
                  <strong>Parking Spots:</strong> {property.parkingSpots || 'N/A'}
                </p>
              </div>
            ))
          ) : (
            <div className="col-span-full text-center text-gray-600">
              No properties found. Please create a new property.
            </div>
          )}
        </div>
      )}
    </div>
  );
}

export default Dashboard;
